import React, { useState, useEffect } from 'react'
import { Link, useNavigate, useLocation, Navigate } from "react-router-dom"
import * as actionType from '../../constants/actionTypes';
import { useDispatch } from 'react-redux';
import { useSelector } from 'react-redux'
import { getAllDorms } from '../../actions/dormss';
import { getAllReviews } from '../../actions/reviews';
import decode from 'jwt-decode';
import Navbar from '../../components/navbar/Navbar'
import './Admin.css'
import SideMenu from '../../components/SideMenu/SideMenu';
import AdminTable from '../../components/Table/Table';
export default function Admin() {
    const [user, setUser] = useState(JSON.parse(localStorage.getItem('profile')));
    const dispatch = useDispatch();
    const location = useLocation();
    const history = useNavigate();
    const dormss = useSelector((state) => state.dormss)
    console.log(dormss)
    const reviews = useSelector((state) => state.reviews)
    console.log(reviews)

    const logout = () => {
        dispatch({ type: actionType.LOGOUT });
        setUser(null);
        history.push('/auth');
    };

    useEffect(() => {
        if (!user || user.result.email !== "wafic@hotmail.com") {
            history('/auth')
        }
        dispatch(getAllDorms());

        dispatch(getAllReviews());



    }, [location]);


    return (
        <div>

            <Navbar />

            {user.result.email === "wafic@hotmail.com" ? (
                <>
                    {/* <div className='Appp'>
                            <SideMenu />
                            <PageContent />
                    </div> */}
                    <div className='Appp'>
                        <div className='navnav'>
                        <div className='titt'>Admin Dashboard</div>
                            <div className="butt1">
                                <button className='butty'>Dorms</button>
                            </div>
                            <div className="butt1">
                                <button className='butty'>Reviews</button>
                            </div>
                            {/* <p>Get Users (delete users)</p>
                        <p>Get Dorms (display dorms that are not yet approved) you can delete or update/approve a dorm</p>
                        <p>Get all schools get all dorms then filter to get the unapproved</p>
                        <p>Get Reviews (get all not approved reviews) delete or approve/update </p>
                         */}


                        </div>
                        <div>
                            <table>
                                <thead>
                                    <tr>
                                        <th>#</th>
                                        <th>Name</th>
                                        <th>Column 3</th>
                                        <th>Column 4</th>
                                        <th>Column 5</th>
                                        <th>Column 6</th>
                                        <th>Column 7</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    <tr>
                                        <td>Row 1, Column 1</td>
                                        <td>Row 1, Column 2</td>
                                        <td>Row 1, Column 3</td>
                                        <td>Row 1, Column 4</td>
                                        <td>Row 1, Column 5</td>
                                        <td>Row 1, Column 6</td>
                                        <td>Row 1, Column 7</td>
                                    </tr>
                                    <tr>
                                        <td>Row 2, Column 1</td>
                                        <td>Row 2, Column 2</td>
                                        <td>Row 2, Column 3</td>
                                        <td>Row 2, Column 4</td>
                                        <td>Row 2, Column 5</td>
                                        <td>Row 2, Column 6</td>
                                        <td>Row 2, Column 7</td>
                                    </tr>
                                    <tr>
                                        <td>Row 3, Column 1</td>
                                        <td>Row 3, Column 2</td>
                                        <td>Row 3, Column 3</td>
                                        <td>Row 3, Column 4</td>
                                        <td>Row 3, Column 5</td>
                                        <td>Row 3, Column 6</td>
                                        <td>Row 3, Column 7</td>
                                    </tr>
                                </tbody>
                            </table>
                        </div>



                    </div>
                </>
            ) : (<>
                <center><h1>This Page does not exist</h1></center>
            </>)}



        </div>
    )
}
